sources.styles\\blocks\\design.scss:
.design {

  &__box {
    margin-bottom: 110px;

    @include onTablet {
      margin-bottom: 140px;
    }

    @include onDesktop {
      margin-bottom: 165px;
    }

    &--title {
      font-weight: 700;
      font-size: 30px;
      line-height: 40px;
      text-transform: uppercase;
      margin-bottom: 30px;

      @include onTablet {
        display: none;
        font-size: 36px;
        line-height: 46px;
      }

      @include onDesktop {
        font-size: 56px;
        line-height: 70px;
      }
    }

    &--title-tablet {
      display: none;

      @include onTablet {
        display: block;
      }
    }

    &--text {
      font-weight: 400;
      font-size: 14px;
      line-height: 21px;
      color: $colorFontGray;
      margin-bottom: 30px;

      @include onTablet {
        font-size: 16px;
        line-height: 24px;
        margin-bottom: 60px;
      }
    }

    &--image {
      width: 100%;
      margin-bottom: 20px;
      transition: all 0.7s ease;

      &:hover {
        scale: 1.1;
      }

      @include onTablet {
        min-height: 415px;
        margin-bottom: 0;
      }

      @include onDesktop {
        display: none;

        &:hover {
          transform: scale(1.1) translateX(-3em);
        }

        &:last-child:hover {
          transform: scale(1.1) translateX(3em);
        }
      }
    }

    &--image-mobile {

      @include onTablet {
        display: none;
      }
    }

    &--image-tablet {
      display: none;

      @include onTablet {
        display: block;
      }

      @include onDesktop {
        display: none;
      }
    }

    &--image-desktop {
      display: none;

      @include onDesktop {
        display: block;
      }
    }

    &--button {

      &--link {
        width: max-content;
        display: block;
        font-weight: 700;
        font-size: 12px;
        line-height: 14px;
        text-transform: uppercase;
        color: $colorAzure;
        text-decoration: none;
        transition: transform 0.5s ease;

        &::after {
          margin-top: 5px;
          content: "";
          display: block;
          height: 1px;
          width: 53px;
          background-color: $colorAzure;
          transition: width 0.7s ease;
        }

        &:hover {
          transform: scale(1.1);

          &:after {
            width: 100%;
          }
        }
      }
    }
  }
}

.container-design {
  padding: 0 30px;

  @include onTablet {
    padding: 0 34px 0 0;

    &:last-of-type {
      padding: 0 0 0 34px;

      @include onDesktop {
        padding: 0 123px;
      }
    }
  }

  @include onDesktop {
    padding: 0 123px;
  }
}

