    align-items: center;
    gap: 44px;
    justify-content: center;
    margin-bottom: 32px;

    @include onTablet {
      margin-bottom: 62px;
    }

    &--link {
      cursor: pointer;
      text-decoration: none;
    }

    &--icon {
      fill: $colorIcons;
      transition: fill 0.5s ease, scale 0.5s ease;

      &:hover {
        fill: $colorAzure;
        scale: 1.2;
      }
    }
  }

  &__copyright {
    font-weight: 400;
    font-size: 14px;
    line-height: 21px;
    text-align: center;
    color: $colroFontLightGray;
    margin-bottom: 20px;

    @include onTablet {
      margin-bottom: 30px;
    }
  }

  &__logo {
    display: none;

    @include onTablet {
      display: flex;
      margin-bottom: 64px;
    }

    &--link {
      margin: 0 auto;

      &--image {
        transition: all 0.7s ease;

        &:hover {
          scale: 1.1;
          fill: $colorGreen;

          path {
            stroke: #a02525;
          }
        }
      }
    }

    &--up {
      position: relative;
      cursor: pointer;

      &-arrow {
        position: absolute;
        right: 24px;
        animation: move 1s ease-in-out infinite;

        &--image {
          fill: #333;
          transition: all 0.7s ease;
        }
      }

      @keyframes move {
        0% {
          transform: translateY(0);
        }

        50% {
          transform: translateY(-20px);
        }

        100% {
          transform: translateY(0);
        }
      }

      &:hover .footer__logo--up-arrow--image {
        scale: 1.5;
        fill: $colorGreen;
      }
    }
  }
}

